import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Image } from "react-bootstrap";
import "./index.css";
import twitterContainer from "./clipart-2-13-12-55-41.png";

function SplashPage() {
  return (
    <Container className="container" fluid>
      <Row>
        <Col className="d-inline mt-5 mb-5">
        <h1>Welcome To Twitter Search Api</h1>
        <h7 className="d-block describe">Search for user and topic tweets user or view a random tweet from one of my five favorite twitter users.</h7>
        <Image className="d-inline mb-5 ml-5 mr-auto twitter-logo" src={twitterContainer} />
        </Col>
      </Row>

    </Container>
  );
}

export default SplashPage;
